					["custom"] = "aura_env.GetProgress = function()\n    local _,_,steps = C_Scenario.GetStepInfo()\n    if not steps or steps <= 0 then\n        return\n    end\n    \n    local percent\n    local _, _, _, _, total, _, _, current = C_Scenario.GetCriteriaInfo(steps)\n    if current then\n        current = tonumber(string.sub(current, 1, string.len(current) - 1)) or 0\n        percent = current / total * 100\n        if percent then\n            percent = (percent <= 0 and 0) or (percent > 100 and 100) or percent\n            return percent, current .. \" / \" .. total, current, total\n        end\n    end\n    return false\nend\n\nif aura_env.config.cPull then\n    aura_env.MDT = MDT\n    if not aura_env.MDT then\n        WeakAuras.prettyPrint((\"|cFFFFFF00%s - 'Display current pull %%'|r require to enable MythicDungeonTools addon\"):format(aura_env.id))\n    end\nend      \n\n",
